@chặt
- 1 đg. Làm đứt ngang ra bằng cách dùng dao, hoặc nói chung vật có lưỡi sắc, giáng mạnh xuống. Chặt cành cây. Chặt tre chẻ lạt. Chặt xiềng (b.).
- 2 t. (thường dùng phụ sau đg.). 1 Ở trạng thái đã được làm cho bám sát vào nhau không rời, khó tách nhau ra, khó gỡ ra. Khoá chặt cửa. Lạt mềm buộc chặt (tng.). Thắt chặt tình bạn (b.). Siết chặt hàng ngũ (b.). 2 Rất khít, không còn kẽ hở nào. Đầm đất cho chặt. Ép chặt. Năng nhặt chặt bị (tng.). Bố cục rất chặt (b.). 3 Không để rời khỏi sự theo dõi, không buông lỏng; chặt chẽ. Kiểm soát chặt. Chỉ đạo rất chặt. 4 (kng.). Sít sao, chi li trong sự tính toán, không rộng rãi. Chi tiêu chặt.

